import React from 'react';
import { useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';
import { Book, BarChart, Star, ChevronRight } from 'lucide-react';

const WelcomePage = () => {
  const navigate = useNavigate();
  
  return (
    <div className="min-h-screen bg-zinc-900 font-serif text-zinc-200">
      {/* Ornate header border */}
      <div className="w-full h-8 bg-gradient-to-r from-amber-700 via-amber-600 to-amber-700"></div>
      
      {/* Main content */}
      <div className="relative w-full max-w-6xl mx-auto px-4 pt-16 pb-24 min-h-screen flex flex-col justify-center">
        {/* Header section with monogram */}
        <header className="text-center mb-16">
          <motion.div
            initial={{ opacity: 0, y: -20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 1, ease: "easeOut" }}
            className="flex flex-col items-center"
          >
            {/* Elegant monogram/crest */}
            <div className="w-32 h-32 mb-8 border-4 border-amber-600 rounded-full flex items-center justify-center">
              <div className="text-5xl font-serif text-amber-600 tracking-tighter">L·AI</div>
            </div>
            
            <h1 className="text-5xl md:text-6xl font-light tracking-widest text-amber-100 mb-6">
              LEARN<span className="text-amber-500">AI</span>
            </h1>
            
            <div className="w-24 h-px bg-amber-700 mb-6"></div>
            
            <motion.p 
              className="text-lg md:text-xl text-zinc-400 max-w-2xl mx-auto font-light italic tracking-wide"
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 0.6, duration: 1 }}
            >
              A distinguished approach to artificial intelligence education
            </motion.p>
          </motion.div>
        </header>

        {/* Features section - styled as elegant cards */}
        <motion.section 
          className="grid grid-cols-1 md:grid-cols-3 gap-8 mb-24"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.8, duration: 1 }}
        >
          <FeatureCard 
            icon={<Book size={28} />}
            title="Curated Curriculum"
            description="Meticulously crafted learning paths tailored to your individual aspirations"
            delay={0.2}
          />
          <FeatureCard 
            icon={<BarChart size={28} />}
            title="Refined Assessment"
            description="Discreet evaluation of your aptitude, highlighting areas of excellence"
            delay={0.4}
          />
          <FeatureCard 
            icon={<Star size={28} />}
            title="Bespoke Challenges"
            description="Precisely calibrated difficulty to ensure continued intellectual growth"
            delay={0.6}
          />
        </motion.section>

        {/* Testimonial section styled as a quote card */}
        <motion.section
          className="mb-24"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 1, duration: 1 }}
        >
          <div className="max-w-3xl mx-auto border border-amber-800 p-12 relative">
            <div className="absolute top-0 left-0 w-4 h-4 border-l-2 border-t-2 border-amber-600 -translate-x-1 -translate-y-1"></div>
            <div className="absolute top-0 right-0 w-4 h-4 border-r-2 border-t-2 border-amber-600 translate-x-1 -translate-y-1"></div>
            <div className="absolute bottom-0 left-0 w-4 h-4 border-l-2 border-b-2 border-amber-600 -translate-x-1 translate-y-1"></div>
            <div className="absolute bottom-0 right-0 w-4 h-4 border-r-2 border-b-2 border-amber-600 translate-x-1 translate-y-1"></div>
            
            <p className="text-lg italic text-zinc-300 mb-6 text-center">
              "LearnAI has elevated my understanding of machine learning principles with the same refinement that one expects from institutions of the highest caliber."
            </p>
            <div className="flex flex-col items-center">
              <div className="w-12 h-px bg-amber-700 mb-4"></div>
              <p className="text-sm uppercase tracking-widest text-amber-500">S. Wellington-Clarke</p>
              <p className="text-xs text-zinc-500">Oxford University, Data Sciences</p>
            </div>
          </div>
        </motion.section>

        {/* CTA section */}
        <motion.div
          className="flex flex-col items-center"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 1.2, duration: 1 }}
        >
          <div className="mb-8 text-center">
            <p className="text-zinc-400 text-sm uppercase tracking-widest mb-2">Est. 2023</p>
            <p className="text-zinc-500">Membership by invitation only</p>
          </div>
          
          <motion.button
            whileHover={{ scale: 1.02 }}
            whileTap={{ scale: 0.98 }}
            className="bg-amber-800 hover:bg-amber-700 text-amber-100 font-light py-4 px-12 text-lg tracking-widest uppercase flex items-center transition-all duration-300"
            onClick={() => navigate('/login')}
          >
            Begin Your Journey
            <ChevronRight className="ml-2" size={16} />
          </motion.button>
        </motion.div>
      </div>
      
      {/* Footer with ornate border */}
      <div className="w-full h-8 bg-gradient-to-r from-amber-700 via-amber-600 to-amber-700"></div>
    </div>
  );
};

const FeatureCard = ({ icon, title, description, delay }) => (
  <motion.div
    whileHover={{ y: -4 }}
    className="bg-zinc-800 border border-amber-900 p-8 flex flex-col items-center text-center transition-all duration-500"
    initial={{ opacity: 0, y: 20 }}
    animate={{ opacity: 1, y: 0 }}
    transition={{ delay: delay + 0.8, duration: 0.8 }}
  >
    <div className="text-amber-600 mb-6 border-2 border-amber-800 rounded-full p-4">{icon}</div>
    <h3 className="text-xl font-light tracking-wide mb-4 text-amber-100 uppercase">{title}</h3>
    <div className="w-12 h-px bg-amber-900 mb-4"></div>
    <p className="text-zinc-400 font-light">{description}</p>
  </motion.div>
);

export default WelcomePage;
